import Auth from './Auth/Auth'
import Emploees from './Employees/Employees'
import Languages from './Languages/Languages'
import Productivity from './Productivity/Productivity'
import Reports from './Reports/Reports'
import SLA from './SLA/SLA'
import Test from './Test/Test'
import Users from './Users/Users'
import WorkingHours from './WorkingHours/WorkingHours'

export default class Routes {

   /**
    * @static {Object}
    */
   static Auth = Auth

   /**
    * @static
    * @returns {Object} 
    */
   static Employees() {
      return Emploees
   }

   static Languages() {
      return Languages
   }

   static Productivity() {
      return Productivity
   }

   static Reports() {
      return Reports
   }

   static SLA() {
      return SLA
   }

   static Test() {
      return Test
   }

   static Users() {
      return Users
   }

   static WorkingHours() {
      return WorkingHours
   }

}
